import React from 'react';
import {Button} from '../../components/Button/Button';
import {TextField} from '../../components/TextField/TextField'


import './login.css'

const Login = () =>  {

    return (
        <div  className='fields'>
            <TextField width={300}  label='Email cím:'/>
            <TextField width={300} label='Jelszó:' />
            <div className='buttons'> 
                <Button label="Bejelentkezés" primary="true" ></Button>
                <Button label="Regisztráció" primary="true"></Button>
            </div>
        </div>
    )
}

export default Login;
